import React from 'react'

export default function CheckoutSteps(props) {
    return (
        <div className="row check-steps">
            <div className={props.step1 ? 'active':''}><p></p></div>
            <div className={props.step2 ? 'active':''}><p></p>Shipping</div>
            <div className={props.step3 ? 'active':''}><p></p>Payment</div>
            <div className={props.step4 ? 'active':''}><p></p>Place Order</div>

        </div>
    )
}
